import React, { ReactElement } from "react";
import { Link } from "react-router-dom";
import "assets/mycss/components.scss";
interface Props {
  tag: string;
  link?: string;
}

export default function Button({ tag, link }: Props): ReactElement {
  return (
    <div>
      <button className="my--btn">
        if(link){<Link to={link}>{tag}</Link>}
      </button>
    </div>
  );
}
